import { Component } from '@angular/core';

interface Region {
  name: string;
  total: string;
  establishments: Establishment[];
}

interface Establishment {
  name: string;
  classes: string;
  progression: number;
  percentage: string;
}

interface Kit {
  type: string;
  remaining: number;
}

interface RealizationEstablishment {
  name: string;
  progress: string;
  progression: number;
}

interface Activity {
  name: string;
  regions: {
    name: string;
    total: string;
    establishments: {
      name: string;
      inscriptions: string;
    }[];
  }[];
}

@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.scss']
})
export class DashboardComponent {
  formations = [
    {
      title: "1ʳᵉ formation des filles - 2ᵉ cycle",
      regions: [
        {
          name: "COMÈ",
          total: "51/51",
          establishments: [
            { name: "CEG 2 COMÈ", classes: "16/16", progression: 100, percentage: "100%" },
            { name: "CEG 4 COMÈ", classes: "16/16", progression: 100, percentage: "100%" },
            { name: "CEG AKODEHA", classes: "19/19", progression: 100, percentage: "100%" }
          ]
        },
        {
          name: "BANTÈ",
          total: "45/45",
          establishments: [
            { name: "CEG 1 BANTÈ", classes: "21/21", progression: 100, percentage: "100%" },
            { name: "CEG AKPASSI", classes: "13/13", progression: 100, percentage: "100%" },
            { name: "CEG ANOUDE", classes: "11/11", progression: 100, percentage: "100%" }
          ]
        },
        {
          name: "HOUÉYOGBÉ",
          total: "51/51",
          establishments: [
            { name: "CEG HOUÉYOGBÉ", classes: "24/24", progression: 100, percentage: "100%" },
            { name: "CEG 1 DOUTOU", classes: "19/19", progression: 100, percentage: "100%" },
            { name: "CEG AHOULOUMÈ", classes: "8/8", progression: 100, percentage: "100%" }
          ]
        },
        {
          name: "SAVALOU",
          total: "44/44",
          establishments: [
            { name: "CEG 1 SAVALOU", classes: "24/24", progression: 100, percentage: "100%" },
            { name: "CEG 2 SAVALOU", classes: "11/11", progression: 100, percentage: "100%" },
            { name: "CEG TCHOGODO", classes: "9/9", progression: 100, percentage: "100%" }
          ]
        }
      ]
    },
    // Ajoutez les autres formations de la même manière
  ];

  sensibilisationData = {
    title: "Sensibilisation des garçons",
    regions: [
      {
        name: "COMÈ",
        total: "51/51",
        establishments: [
          { name: "CEG 2 COMÈ", classes: "16/16", progression: 100, percentage: "100%" },
          { name: "CEG 4 COMÈ", classes: "16/16", progression: 100, percentage: "100%" },
          { name: "CEG AKODEHA", classes: "19/19", progression: 100, percentage: "100%" }
        ]
      },
      // ... autres régions
    ]
  };

  kitsData = {
    title: "NB DE KITS RESTANTS",
    regions: [
      {
        name: "BANTÈ",
        total: "113",
        warning: true,
        kits: [
          { type: "Kits moyens de 4", remaining: 0 },
          { type: "Kits moyens de 2", remaining: 72 },
          { type: "Grands kits de 4", remaining: 41 },
          { type: "Grands kits de 2", remaining: 0 }
        ]
      },
      {
        name: "COMÈ",
        total: "890",
        warning: false,
        kits: [
          { type: "Kits moyens de 4", remaining: 100 },
          { type: "Kits moyens de 2", remaining: 280 },
          { type: "Grands kits de 4", remaining: 310 },
          { type: "Grands kits de 2", remaining: 200 }
        ]
      },
      // ... autres régions
    ]
  };

  realizationData = {
    title: "TAUX DE RÉALISATION DES ÉLECTIONS",
    regions: [
      {
        name: "BANTÈ",
        total: "28/28",
        percentage: 100,
        establishments: [
          { name: "CEG 1 BANTÈ", progress: "6/6", progression: 100 },
          { name: "CEG AKPASSI", progress: "10/10", progression: 100 },
          { name: "CEG ANOUDE", progress: "12/12", progression: 100 }
        ]
      },
      {
        name: "COMÈ",
        total: "10/25",
        percentage: 40,
        establishments: [
          { name: "CEG 2 COMÈ", progress: "0/3", progression: 0 },
          { name: "CEG 4 COMÈ", progress: "10/10", progression: 100 },
          { name: "CEG AKODEHA", progress: "0/12", progression: 0 }
        ]
      },
      // ... autres régions
    ]
  };

  activitiesData = {
    title: "NB D'INSCRITS POUR CHAQUE ACTIVITÉ RÉCRÉATIVE",
    activities: [
      {
        name: "SLAM",
        regions: [
          {
            name: "BANTÈ",
            total: "45",
            establishments: [
              { name: "CEG 1 BANTÈ", inscriptions: "21" },
              { name: "CEG AKPASSI", inscriptions: "13" },
              { name: "CEG ANOUDE", inscriptions: "11" }
            ]
          },
          // ... autres régions
        ]
      },
      {
        name: "ART PLASTIQUE",
        regions: [
          // ... données similaires
        ]
      }
    ]
  };

  getProgressColor(percentage: number): string {
    if (percentage >= 100) return 'bg-green-500';
    if (percentage >= 50) return 'bg-yellow-500';
    return 'bg-red-500';
  }

  selectedFormation = this.formations[0];
}
<div class="container mx-auto space-y-8">
  <!-- Section Sensibilisation -->
  <section>
    <h2 class="text-xl font-medium text-blue-600 mb-6">{{ sensibilisationData.title }}</h2>
    <div class="grid grid-cols-2 gap-6">
      <div *ngFor="let region of sensibilisationData.regions" class="bg-white rounded-lg shadow-sm">
        <div class="bg-[#4070B8] text-white p-4 rounded-t-lg flex justify-between items-center">
          <span class="font-medium">{{ region.name }}</span>
          <span>{{ region.total }}</span>
          <span>100%</span>
        </div>
        <div class="p-4">
          <table class="w-full">
            <thead>
              <tr class="text-left text-gray-600 border-b">
                <th class="pb-2">Établissement</th>
                <th class="pb-2">Nb classes</th>
                <th class="pb-2">Progression</th>
                <th class="pb-2 text-right">Pourcentage</th>
              </tr>
            </thead>
            <tbody>
              <tr *ngFor="let establishment of region.establishments" class="border-b last:border-b-0">
                <td class="py-3">{{ establishment.name }}</td>
                <td class="py-3">{{ establishment.classes }}</td>
                <td class="py-3 pr-4">
                  <div class="w-full bg-gray-200 rounded-full h-2">
                    <div class="bg-green-500 h-2 rounded-full" [style.width]="establishment.progression + '%'"></div>
                  </div>
                </td>
                <td class="py-3 text-right">{{ establishment.percentage }}</td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
    </div>
  </section>

  <!-- Section Kits Restants -->
  <section>
    <h2 class="text-xl font-medium text-blue-600 mb-6 flex items-center justify-between">
      {{ kitsData.title }}
      <i class="pi pi-chevron-down cursor-pointer"></i>
    </h2>
    <div class="grid grid-cols-4 gap-6">
      <div *ngFor="let region of kitsData.regions" 
           class="bg-white rounded-lg shadow-sm overflow-hidden"
           [ngClass]="{'border-red-500 border-2': region.warning}">
        <div [class]="'p-4 text-white flex justify-between items-center ' + (region.warning ? 'bg-red-500' : 'bg-[#4070B8]')">
          <span class="font-medium">{{ region.name }}</span>
          <span>{{ region.total }}</span>
        </div>
        <div class="p-4">
          <table class="w-full">
            <thead>
              <tr class="text-left text-gray-600 border-b">
                <th class="pb-2">Type de kits</th>
                <th class="pb-2 text-right">Nb restant</th>
              </tr>
            </thead>
            <tbody>
              <tr *ngFor="let kit of region.kits" class="border-b last:border-b-0">
                <td class="py-3">{{ kit.type }}</td>
                <td class="py-3 text-right">{{ kit.remaining }}</td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
    </div>
  </section>

  <!-- Section Taux de Réalisation -->
  <section>
    <h2 class="text-xl font-medium text-blue-600 mb-6 flex items-center justify-between">
      {{ realizationData.title }}
      <i class="pi pi-chevron-down cursor-pointer"></i>
    </h2>
    <div class="grid grid-cols-2 gap-6">
      <div *ngFor="let region of realizationData.regions" class="bg-white rounded-lg shadow-sm">
        <div class="bg-[#4070B8] text-white p-4 rounded-t-lg flex justify-between items-center">
          <span class="font-medium">{{ region.name }}</span>
          <div class="flex items-center gap-4">
            <span>{{ region.total }}</span>
            <div class="w-32 bg-gray-200 rounded-full h-2">
              <div [class]="'h-2 rounded-full ' + getProgressColor(region.percentage)"
                   [style.width]="region.percentage + '%'"></div>
            </div>
            <span>{{ region.percentage }}%</span>
          </div>
        </div>
        <div class="p-4">
          <div *ngFor="let establishment of region.establishments" class="py-2">
            <div class="flex justify-between items-center mb-1">
              <span class="text-gray-700">{{ establishment.name }}</span>
              <span class="text-gray-600">{{ establishment.progress }}</span>
            </div>
            <div class="w-full bg-gray-200 rounded-full h-2">
              <div [class]="'h-2 rounded-full ' + getProgressColor(establishment.progression)"
                   [style.width]="establishment.progression + '%'"></div>
            </div>
          </div>
        </div>
      </div>
    </div>
  </section>

  <!-- Section Activités Récréatives -->
  <section>
    <h2 class="text-xl font-medium text-blue-600 mb-6 flex items-center justify-between">
      {{ activitiesData.title }}
      <i class="pi pi-chevron-down cursor-pointer"></i>
    </h2>
    <div class="space-y-6">
      <div *ngFor="let activity of activitiesData.activities" class="bg-white rounded-lg shadow-sm p-6">
        <h3 class="text-lg font-medium text-gray-800 mb-4">{{ activity.name }}</h3>
        <div class="grid grid-cols-4 gap-6">
          <div *ngFor="let region of activity.regions" class="bg-[#4070B8] rounded-lg overflow-hidden">
            <div class="bg-[#4070B8] text-white p-4 flex justify-between items-center">
              <span class="font-medium">{{ region.name }}</span>
              <span>{{ region.total }}</span>
            </div>
            <div class="bg-white p-4">
              <table class="w-full">
                <thead>
                  <tr class="text-left text-gray-600 border-b">
                    <th class="pb-2">Établissement</th>
                    <th class="pb-2 text-right">Nb d'inscrits</th>
                  </tr>
                </thead>
                <tbody>
                  <tr *ngFor="let establishment of region.establishments" class="border-b last:border-b-0">
                    <td class="py-3">{{ establishment.name }}</td>
                    <td class="py-3 text-right">{{ establishment.inscriptions }}</td>
                  </tr>
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
    </div>
  </section>
</div>
